import * as React from "react";
import {
  AreaChart,
  Area,
  linearGradient,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip
} from "recharts";
import { curveCardinal } from "d3-shape";
import { useFetchApi } from "../../../utils/hooks";
import { IAM_APP, REPORTS_USERS } from '../../../utils/constants';
import { UrlQuery } from "../../../utils/utils";

const data = [
  {
    name: "Page A",
    uv: 4000,
    pv: 2400,
    amt: 2400
  },
  {
    name: "Page B",
    uv: 3000,
    pv: 1398,
    amt: 2210
  },
  {
    name: "Page C",
    uv: 2000,
    pv: 9800,
    amt: 2290
  },
  {
    name: "Page D",
    uv: 2780,
    pv: 3908,
    amt: 2000
  },
  {
    name: "Page E",
    uv: 1890,
    pv: 4800,
    amt: 2181
  },
  {
    name: "Page F",
    uv: 2390,
    pv: 3800,
    amt: 2500
  },
  {
    name: "Page G",
    uv: 3490,
    pv: 4300,
    amt: 2100
  }
];
const cardinal = curveCardinal.tension(0.2);

export default function NumOfUsers({ type }) {

  const [params, setParams] = React.useState({ status__in: "", size: 10, page: 0 });
  const [{ data, isLoading, hasError }, doFetch] = useFetchApi(undefined, []);
  // const [type, setType] = React.useState();

  React.useEffect(() => {
    doFetch("GET", IAM_APP, UrlQuery(REPORTS_USERS(type), { ...params }))
  }, [params])

  return (
    <AreaChart width={730} height={250} data={data}
      margin={{ top: 10, right: 30, left: 0, bottom: 0 }}>
      <defs>
        <linearGradient id="colorPv" x1="0" y1="0" x2="0" y2="1">
          <stop offset="5%" stopColor="#10D078" stopOpacity={0.8} />
          <stop offset="95%" stopColor="#10D078" stopOpacity={0} />
        </linearGradient>
      </defs>
      <XAxis dataKey="name" />
      <YAxis />
      <CartesianGrid strokeDasharray="2 2" vertical={false} horizontal={true} />
      <Tooltip />
      <Area type="monotone" dataKey="pv" stroke="#10D078" fillOpacity={1} fill="url(#colorPv)" />
    </AreaChart>
  );
}
